Movie Info: Arikil Oraal is a 2013 Indian mystery thriller film scripted and directed by Sunil Ibrahim. It stars Indrajith Sukumaran as a creative ad director, Remya Nambeesan as a trained dancer, Nivin Pauly as a waiter at a cafe, Prathap Pothen as a psychologist and Lena Abhilash as the head of a corporation. The cinematography was by Krish Kymal, and the music was scored by Gopi Sunder. Arikil Oraal was produced by Ashiq Usman under the banner of Milestone Cinemas. The film started shooting in April 2013 in Kochi.[6] The film released on 30 August 2013

